			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n# 1\n# Set bash script to exit immediately if any commands fail.\n# that script for being sure the bundle files are lastest build.\nset -e\n\n#plist文件位置\nplist=${INFOPLIST_FILE}\n\n#Define文件夹目录\ndefinePath=\"${PROJECT_DIR}/../CmgeKit/CmgeKit/Define\"\n#版本号构建号文件夹目录\nverBuildFilePath=\"${definePath}/CmgeCoreConstantDefine.h\"\n#联运开关类型文件夹目录\njointFilePath=\"${definePath}/CmgeAdvanceCoreConstantDefine.h\"\n\n#read version number \nVERSION_NUMBER=`grep '^#define VERSION_CN' ${verBuildFilePath} | sed -n 's/#define VERSION_CN @\"\\(.*\\)\"/\\1/gp'`\n\n#read build number\nBUILD_NUMBER=`grep '^#define Build_CN' ${verBuildFilePath} | sed -n 's/#define Build_CN @\"\\(.*\\)\"/\\1/gp'`\n\n#mutiple switches, 集团默认全关\nJGTypeCount=0\n\n#检测第三方ZF是否打开\n#thirdPartyZF=`sed -n 's/^#define THIRD_PARTY_ZF/THIRD_PARTY_ZF/gp' ${jointFilePath}`\n#if [[ $thirdPartyZF == \"THIRD_PARTY_ZF\" ]]\n#then\n#    let \"JGTypeCount=((1<<0))\"\n#fi\n\n#检测是否强制关闭账号\n#forceOffAccount=`sed -n 's/^#define FORCE_DISABLE_ACCOUNTLOGIN/FORCE_DISABLE_ACCOUNTLOGIN/gp' ${jointFilePath}`\n#if [[ $forceOffAccount == \"FORCE_DISABLE_ACCOUNTLOGIN\" ]]\n#then\n#    let \"JGTypeCount=JGTypeCount + ((1<<1))\"\n#    echo \"you are here\"\n#fi\n\n#build number + switches\nBUILD_AND_TYPE=\"$BUILD_NUMBER.$JGTypeCount\"\n\n\n#这段代码是为了防止build number和version number为空的情况了，先默认给一个\nif [[ $VERSION_NUMBER == \"\" ]]\nthen\n    VERSION_NUMBER=\"1.0.0\"\nfi\n\nif [[ $BUILD_AND_TYPE == \".0\" ]]\nthen\n    BUILD_AND_TYPE=\"202301011000.0\"\nfi\n\n#change version number\n/usr/libexec/Plistbuddy -c \"Set CFBundleShortVersionString $VERSION_NUMBER\" \"${plist}\"\n\n\n#change build number\n/usr/libexec/Plistbuddy -c \"Set CFBundleVersion $BUILD_AND_TYPE\" \"${plist}\"\n";
